import React from "react";
import { useState, useEffect } from "react";
import { styled } from "@mui/material/styles";
import "./Main.css";

import Portrait from "./Michael_Kim.png";
import AboutMe from "./AboutMe.png";
import Battery from "./Battery.png";
import Proteins1 from "./Proteins1.png";
import Proteins2 from "./Proteins2.png";
import Proteins3 from "./Proteins3.png";
import Proteins4 from "./Proteins4.png";
import Proteins5 from "./Proteins5.png";
import Science1 from "./Science1.png";
import TeamfightTactics from "./TeamfightTactics.jpeg";
import Wine from "./Wine.png";

import ProteomicsWork from "./Proteomics.jpg";
import BatteryWork from "./BatteryWork.png";
import InboundWork from "./Inbound.png";
import BastiatWork from "./BastiatPartners.jpg";
import NorthwesternWork from "./NorthwesternWork.jpg";

import GitHubIcon from "./GitHub.png";
import LinkedInIcon from "./LinkedInLogo.png";
import EmailIcon from '@mui/icons-material/Email';

import HomeLogo from "./Logo.png";

import ArrowForwardIcon from '@mui/icons-material/ArrowForward';

const ImgNoMargin = styled("img")({
	maxWidth: "100%",
	maxHeight: "100%",
});

function useTextRotation(texts, duration) {

	const [text, setText] = useState('');
	const [index, setIndex] = useState(0);

	useEffect(() => {

	  const tick = () => {
		let nextIndex = index + 1;
		if(nextIndex >= texts.length) {
		  nextIndex = 0; 
		}

		let currentText = texts[index];

		setText(currentText.substring(0, text.length + 1));

		if(text === currentText) {
		  setTimeout(() => {
			setIndex(nextIndex);
			setText('');
		  }, duration);
		}
	  }

	  const interval = setInterval(tick, 150);
	  return () => clearInterval(interval);

	}, [texts, index, text, duration]);

	return text;

  }


function TxtRotate({texts, duration}) {

	const rotatedText = useTextRotation(texts, duration);

	return (
		<span className="txt-rotate">
		<span className="wrap">{rotatedText}</span> 
		</span>
	);

}  

const Main = () => {
	const [windowWidth, setWindowWidth] = useState(window.innerWidth);

	useEffect(() => {
		const handleResize = () => {
		setWindowWidth(window.innerWidth);
		};

		window.addEventListener('resize', handleResize);

		return () => {
		window.removeEventListener('resize', handleResize);
		};
	}, []);

    return (
		<div className="view">
			<div 
				style={{
					backgroundColor: "#f0fff1",
					minWidth: "calc(100vw - 40px)",
					minHeight: "calc(100vh - 40px)",
					position: "relative",
					overflow: "hidden"
				}}
			>
				<div
					style={{
						zIndex: 10000,
						display: "flex",
						justifyContent: "space-between",
						alignItems: "center",
						width: "calc(100vw - 160px)",
						backgroundColor: "#f0fff1",
						padding: "15px 60px 15px",
						position: "fixed"
					}}
				>
					<a href="/">
						<img src={HomeLogo} width={"60px"} alt='Logo' />
					</a>
					<div
						style={{
							display: "flex",
							alignItems: "center"
						}}
					>	
						<a href="https://github.com/mkim45" target="_blank" rel="noopener noreferrer" underline="none">
							<ImgNoMargin
								alt="githubtop"
								src={GitHubIcon}
								sx={{ height: "40px", width: "40px", paddingRight: "20px" }}
							/>
						</a>
						<a href="https://www.linkedin.com/in/michael-kim-nu/" target="_blank" rel="noopener noreferrer" underline="none">
							<ImgNoMargin
								alt="linkedintop"
								src={LinkedInIcon}
								sx={{ height: "40px", width: "40px" }}
							/>
						</a>
					</div>
				</div>
				<div 
					style={{ 
						marginLeft: "40px",
						marginRight: "40px"
					}}
				>
					<div
						style={{
							minHeight: "100%",
							paddingTop: windowWidth >= 1075 ? "69px" : "89px",
							display: "flex",
							alignItems: "center",
							overflow: "hidden",
							justifyContent: "space-between",
							maxWidth: "1200px",
							margin: "0px auto",
							flexDirection: windowWidth < 1075 ? "column" : "row"
						}}
					>
						{windowWidth < 1075 ? (
							<div
								style={{
									display: "flex", justifyContent: "center", marginTop: "20px"
								}}
							>
								<ImgNoMargin
									alt="portrait"
									src={Portrait}
									sx={{ height: "350px", width: "233.33px" }}
								/>
							</div>
						) : null}
						<div
							style={{
								marginTop: windowWidth < 1075 ? "30px" : "0px"
							}}
						>
							<div
								style={{
									minHeight: "25vh",
									maxWidth: "100%",
									display: "flex",
									textAlign: windowWidth < 1075 ? "center" : "start",
									justifyContent: "center",
									flexDirection: "column"
								}}
							>
								<h1
									style={{
										fontSize: windowWidth < 500 ? "54px" : "72px",
										fontFamily: "Bitter, serif",
										fontWeight: "normal",
										color: "#1b4332",
										margin: "0px"
									}}
								>
									Hi, my<br></br>name is <b>Michael</b><span style={{ color: "#52b788" }}>.</span>
								</h1>
								<p
									style={{
										fontSize: windowWidth < 500 ? "20px" : "24px",
										maxWidth: "525px",
										marginTop: "30px",
										lineHeight: 1.65,
										color: "#1b4332"
									}}
								>
									I'm a <b>software engineer</b> and <b>data scientist</b> interested in improving human experiences through&nbsp;
									<TxtRotate 
										texts={["multiomics.&nbsp;", "machine learning.&nbsp;", "startups.&nbsp;", "software development.&nbsp;", "bioinformatics.&nbsp;"]}
										duration={1500}  
									/>
									{/* <span class="txt-rotate"
										style={{
											fontWeight: "bold",
											color: "#1b4332"
										}} 
										data-period="1500"
										data-rotate='["multiomics.&nbsp;", "machine learning.&nbsp;", "startups.&nbsp;", "software development.&nbsp;", "bioinformatics.&nbsp;"]'>
									</span> */}
								</p>
							</div>
						</div>
						{windowWidth >= 1075 ? (
							<div
								style={{
									marginTop: "40px",
								}}
							>
								<ImgNoMargin
									alt="portrait"
									src={Portrait}
									sx={{ height: "525px", width: "350px" }}
								/>
							</div>
						) : null}
					</div>
					{windowWidth >= 1075 ? (
						<div
							style={{
								margin: "100px auto 0px",
								flexDirection: "row",
								justifyContent: "space-between",
								display: "flex",
								maxWidth: "1200px"
							}}
						>
							<div
								style={{
									width: "60%"
								}}
							>
								<div
									style={{
										position: "relative",
										marginBottom: "36.5px"
									}}
								>
									<h2
										style={{
											fontSize: "64px",
											fontFamily: "Bitter, serif",
											fontWeight: "bold",
											color: "#1b4332",
											margin: "0px"
										}}
									>
										About me<span style={{ color: "#52b788" }}>.</span>
									</h2>
									<div
										style={{
											width: "80px",
											height: "3.5px",
											backgroundColor: "#52b788",
											marginTop: "10px"
										}}
									></div>
								</div>
								<div
									style={{
										margin: "0px auto",
										position: "relative"
									}}
								>
									<p
										style={{
											fontSize: "17px",
											marginTop: "0px",
											lineHeight: 1.65,
											color: "#1b4332",
											marginBottom: "25px"
										}}
									>
										Im a <b>third-year undergraduate student</b> at Northwestern University, pursuing a B.A. in Biology and Data Science 
										and an M.S. in Computer Science through a B.A./M.S. program.<br/><br/>
										While initially exploring investment banking and venture capital internships, I found myself far more passionate 
										about the transformative work of the startups I was actually advising and sourcing. Since then, Ive been fortunate to build 
										software for a <b>multiomics research lab</b>, a <b>venture capital firm</b>, and an <b>HR software startup</b>. I'm eager to continue 
										imparting meaningful impact, particularly at innovative and disruptive startups.<br/><br/>
										Currently, Im leading a project at the <b>Proteomics Center of Excellence</b> to create an OS-agnostic mass spectrometry insights platform. 
										On the side, Ive been creating a multiomics quality control tool with <b>autoencoder neural network and tree-based models</b>.<br/><br/>
										While Im not coding, I enjoy playing tennis, learning new languages, spending time outdoors with friends, playing Teamfight Tactics, and reading books on human behavior. 
									</p>
								</div>
							</div>
							<div
								style={{
									marginTop: "114px"
								}}
							>
								<ImgNoMargin
									alt="aboutMe"
									src={AboutMe}
									sx={{ height: "425px", width: "365px" }}
								/>
							</div>
						</div>
					) : (
						<div
							style={{
								margin: "100px auto 0px",
								flexDirection: "row",
								justifyContent: "space-between",
								display: "flex",
								maxWidth: "1200px"
							}}
						>
							<div
								style={{
									width: "100%"
								}}
							>
								<div
									style={{
										position: "relative",
										marginBottom: "36.5px"
									}}
								>
									<h2
										style={{
											fontSize: "64px",
											fontFamily: "Bitter, serif",
											fontWeight: "bold",
											color: "#1b4332",
											margin: "0px"
										}}
									>
										About me<span style={{ color: "#52b788" }}>.</span>
									</h2>
									<div
										style={{
											width: "80px",
											height: "3.5px",
											backgroundColor: "#52b788",
											marginTop: "10px"
										}}
									></div>
								</div>
								<div
									style={{
										margin: "0px auto",
										position: "relative"
									}}
								>
									<p
										style={{
											fontSize: "17px",
											marginTop: "0px",
											lineHeight: 1.65,
											color: "#1b4332",
											marginBottom: "25px"
										}}
									>
										Im a <b>third-year undergraduate student</b> at Northwestern University, pursuing a B.A. in Biology and Data Science 
										and an M.S. in Computer Science through a B.A./M.S. program.<br/><br/>
										While initially exploring investment banking and venture capital internships, I found myself far more passionate 
										about the transformative work of the startups I was actually advising and sourcing. Since then, Ive been fortunate to build 
										software for a <b>multiomics research lab</b>, a <b>venture capital firm</b>, and a <b>startup</b>. I'm eager to continue 
										imparting meaningful impact, particularly at innovative and disruptive startups.<br/><br/>
										Currently, Im leading a project at the <b>Proteomics Center of Excellence</b> to reverse engineer and improve Thermo Fisher Scientifics mass 
										spectrometry software. On the side, Ive been creating a multiomics quality control tool with <b>autoencoder neural network models</b>.<br/><br/>
										While Im not coding, I enjoy playing tennis, learning new languages, spending time outdoors with friends, and reading books on human behavior. 
									</p>
								</div>
							</div>
						</div>
					)}
					{windowWidth >= 890 ? (
						<div
							style={{
								margin: "100px auto 0px",
								maxWidth: "1200px"
							}}
						>
							<div
								style={{
									width: "100%"
								}}
							>
								<div
									style={{
										position: "relative",
										marginBottom: "36.5px"
									}}
								>
									<h2
										style={{
											fontSize: "64px",
											fontFamily: "Bitter, serif",
											fontWeight: "bold",
											color: "#1b4332",
											margin: "0px"
										}}
									>
										About my work<span style={{ color: "#52b788" }}>.</span>
									</h2>
									<div
										style={{
											width: "80px",
											height: "3.5px",
											backgroundColor: "#52b788",
											marginTop: "10px"
										}}
									></div>
								</div>
								<div
									style={{
										margin: "0px auto",
										position: "relative"
									}}
								>
									<p
										style={{
											fontSize: "17px",
											marginTop: "0px",
											lineHeight: 1.65,
											color: "#1b4332",
